import React from 'react';
import PropTypes from 'prop-types';
import { Container, Nav, NavItem, NavLink, Navbar, NavbarBrand, NavbarCollapse, NavbarToggle } from 'react-bootstrap';

const mystyle = {
  color: "white",
  backgroundColor: "DodgerBlue",
  padding: "10px",
  fontFamily: "Arial"
};

export default function NavBar(props) {
  return (

    <Navbar style={{ backgroundColor: 'black' }} expand="lg" className='bg-body-tertiary' >
      <Container fluid>
        <NavbarBrand style={{ color: 'gold', fontWeight: 'bold' }}>Vanesara</NavbarBrand>
        <NavbarCollapse style={{ color: 'gold' }} id='navbarScroll'>
          <Nav justify variant='tabs'
            className="me-auto my-2 my-lg-0"
            style={{ maxWidth: '100vw' }}
            navbarScroll
          >

            <NavItem style={{ color: 'gold' }}><NavLink style={{ color: 'gold' }} href="home">Clearance Sale</NavLink></NavItem>
            <NavItem style={{ color: 'gold' }}><NavLink style={{ color: 'gold' }} href="home">New Arrivals</NavLink></NavItem>
            <NavItem style={{ color: 'gold' }}><NavLink style={{ color: 'gold' }} href="home">Handcrafted Sarees</NavLink></NavItem>
            <NavItem style={{ color: 'gold' }}><NavLink style={{ color: 'gold' }} href="home">Video Shopping</NavLink></NavItem>

          </Nav>

        </NavbarCollapse>
      </Container>
    </Navbar>

  );
}
NavBar.propTypes = { applicationName: PropTypes.string, poweredByName: PropTypes.string.isRequired };
NavBar.defaultProps = { applicationName: "Application Name", poweredByName: "Company" };
